import React, { Component } from "react";
import Button from "react-bootstrap/Button";
export default class Card extends Component {
  state = {};
  componentDidMount = () => {};
  constructor(props) {
    super();
  }
  render() {
    return <Button >{this.props.value}</Button>;
  }
}
